import { Dialog } from '@mui/material';


const dialogStyle = {
    height: '96%'
}

const LoginDialog = () =>
{
    return(
        <Dialog
        open = {true}
        PaperProps = {{sx:dialogStyle}}>
            Hello
        </Dialog>
    )
}

export default LoginDialog;
